import React from 'react'

function CartItem() {
  return (
    <div className='cart-item'>

      <div className="i-photo"><img src="" alt="" /></div>

      <p className="i-name">Pastel Pink T-shirt</p>
      <p className="i-number">01</p>
      <p className="i-number">$86</p>
      <span className='i-btn'>CHECK OUT</span>
    </div>
  )
}

export default CartItem
